<?php

use Illuminate\Foundation\Testing\WithoutMiddleware;
use Illuminate\Foundation\Testing\DatabaseMigrations;
use Illuminate\Foundation\Testing\DatabaseTransactions;

class TargetTest extends TestCase
{

    // Automatically rollback database changes.
    use DatabaseMigrations; // fixme/bug - database isn't cleared.

    /**
     * Test if a target is persisted correctly, including the image.
     */
    public function testAddTarget(){
        $target = factory(App\Target::class)->make();
        $target->game_id = 42;
        $target->image = '';
        $target->name = "test image";

        echo "Target: " . $target . "\n";

        $response = $this->call("POST", "api/v1/target/add", ['gameId' => 42, 'name' => 'testtarget', 'image' => $target->image, 'qrCode' => 'ABCDEFQR']);

        echo "Response: " . $response->getStatusCode() . ", with HTTP code: " . $response->getStatusCode() . "\n";

        self::assertEquals('200', $response->getStatusCode());
    }

    /**
     * Add tests and check if the right one is returned.
     */
    public function testGetTargets(){
        // todo - make _valid_ target?
        $target = factory(App\Target::class)->make();
        $target->game_id = 42;
        $target->save();

        echo "Target: " . $target . "\n";

        // add target.
        $this->json('POST', '/target/add', [json_encode($target)]);

        // check target is returned.
        $response = $this->call("GET", "api/v1/target/get", ['id' => $target->id]);

        echo "Response: " . $response . "\n";

//        self::assertEquals(json_encode($target), $response->content());
        self::assertEquals($target->id, json_decode($response->content())->id);
    }
}
